import React, {useState, useEffect} from "react";
import Sound from "react-sound"; 
import "../styles/Home.css";
import Nav from "./NavBar";
import "../styles/Navbar.css";
import videoBG from "../styles/background3.mp4";
import soundBG from "../styles/background9.mp3";
import post from "../styles/HomeBackground.jpg"
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import LoanerLogin from './LoanerLogin'
import Navbar from "./NavBar";
import { useAuth } from "./auth";
import Axios from 'axios';


function LoanerHistoryPage() {
  const auth = useAuth();
  const [data, setData] = useState([]);

  function history() {
      
    Axios.post("http://localhost:3001/api/getHistory", {
    username: auth.user
  }).then((response) => {
    console.log(response.data);
    setData(response.data);
    // setFName(response.data[0].FirstName);
    // setLName(response.data[0].LastName);
    // setPhoNumber(response.data[0].PhoneNumber);
    // setEmail(response.data[0].EmailAddress);
    // setUsername(response.data[0].username);
    
  }) 

}

  return (
    
    <body>
      <video class="Video" src={videoBG} autoPlay muted loop playsInline/>
      
     <Nav></Nav> 
    
    <div class="Welcome">
        <h1 class="Heading"> Loaner Home Page </h1>
        <div> Welcome {auth.user} </div>
      
      </div>
      <div class="Information">
        <div>
          {history()}
        </div>

        <div class="Cars">

{
  
  data.map( (getD)=>(

    
    <div key={getD.regNumber}>
      <div class = "Car">
      <a>{getD.make} {getD.model}</a>
      <br></br>
        <div class="Price">Price: {  getD.price  } per day</div>
        <br></br>
        <div class="Picture"><strong></strong><img class="Picture" src={require(`../imgs/${  getD.photo  }`)} width="300" height="215" /> </div>
        <br></br>
        <div class="button">
        <button class="button4" onClick={() => DetailPage("/CarDetails/"+getD.regNumber)}>Reserve / Find out more</button>
        </div>
        <br></br>

      </div>
      <br>
      
      </br>
        
    
    </div>
    

  )
  
  )
}
</div>

    
      </div>


  

    </body>  
  
  );
}

export default LoanerHistoryPage;
